import React from 'react'
import ReactDOM from 'react-dom'

const Header = (props) => {
    console.log(props)
    return (
        <>
        <p>Kurssin nimi: {props.course}</p>
        </>
    )
}

const Part = (props) => {
    console.log(props)
    return (
        <div>
        <p>Osan nimi: {props.part}, tehtäviä: {props.exercises} </p>
        </div>
    )
}

const Content = (props) => {
    console.log(props)
    return (
        <>
        <Part part={props.part1} exercises={props.exercises1}/>
        <Part part={props.part2} exercises={props.exercises2}/>
        <Part part={props.part3} exercises={props.exercises3}/>
        </>
    )


}

const Total = (props) => {
    console.log(props)
    return (
        <>
        <p>Tehtäviä yhteensä: {props.yhteensa}</p>
        </>
    )
}

const App = () => {
  const course = 'Half Stack -sovelluskehitys'
  const part1 = 'Reactin perusteet'
  const exercises1 = 10
  const part2 = 'Tiedonvälitys propseilla'
  const exercises2 = 7
  const part3 = 'Komponenttien tila'
  const exercises3 = 14


  return (
    <>
     <Header course={course}/>
     <Content part1={part1} part2={part2} part3={part3} 
     exercises1={exercises1} exercises2={exercises2} 
     exercises3={exercises3}/>
     <Total yhteensa={exercises1 + exercises2 + exercises3}/>
    </>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
